const arrays = [
    {
        id: 1,
        name: 'Mark'
    },
    {
        id: 2,
        name: 'Mark'
    },
    {
        id: 3,
        name: 'Mark'
    },
    {
        id: 4,
        name: 'Mark'
    },
]
const ArrayMaps = arrays.map((array =>
    <div key = {array.id} className = "array-wrapper">
        <div className="array-name">
            <h1>{array.name}</h1>
        </div>
    </div>
    ))

function Array(){
    return(
        <ArrayMaps />
    )
}

export default Array
